import logo from './logo.svg';
import './App.css';
import React from 'react';
import Welcome from './components/Welcome'
import Clothes from "./Clothes";

function App(props) {
  const name = "Tran Minh Tuong";
  function formatName(user) {
    return user.firstName + ' '+ user.lastname;
  }
  const user = {
    firstName: 'Nguyen',
    lastname: 'Tri'
  };

  const element = (
  <h1>
    Xin chào , {formatName(user)}!
  </h1>
  );

  return (
    <div>
    <h1>Hello React.js - Freetuts.net</h1>
    <h2>Han Hanh Xin Chao {name} hoc Reactjs </h2>
    {element}
    <Welcome />
    <p>Thuong lo binh tinh</p>
    <Clothes name="Quần jean" type="Skinny" color ="Đen" size = "L">Clothes 1</Clothes>
    <Clothes name="Váy" type="váy công chúa" color ="Trắng" size = "M">Clothes 2</Clothes>
    </div>

  );
}
export default App;
